import './App.css';
import profile from './profile.jpg';


function App() {
  return (
    <>
      <h1>{user.name}</h1>
      {getBtn("cancel")}
      <img 
        className='avatar'
        src={user.img}
        alt={'image for '+ user.name}
        style={{
          width: user.imgSize,
          height: user.imgSize
        }}
      />

    </>
  );
}

function getBtn(name) {
    let btn = <button>{name}</button>;
    return btn;
  }

const user = {
  name : "shekil",
  age : 21,
  img : profile,
  imgSize : 90
};
